import { Box } from "@mui/system";
import { useEffect, useState } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { Container } from '@mui/system';
import { createTheme, CssBaseline, ThemeProvider, Typography } from "@mui/material";
import SMInput from "../../config/components/input";
import SMButton from "../../config/components/button";
import { editformData, sendData } from "../../config/firebase/firebasemethods";


function EditForm() {

  const theme = createTheme();
  const navigate = useNavigate()



  const location = useLocation();
  const [formEdit,setFormEdit] = useState([])
 
  useEffect(()=>{
    setFormEdit(location.state);
  console.log(formEdit)
},[])

console.log(formEdit)

  let [editData, setEditData] = useState([])
  const editfunc = () => {
    editformData(editData, 'course').then(() => {
        console.log("data transfer")
        navigate("/news")

    }).catch((err) => {
        console.log(err)
    })
   console.log(editData)

}


//   console.log(`STATE======>`,location.state)




 
  return (
    <Box>

<ThemeProvider theme={theme}>
    <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
            sx={{
                marginTop: 8,
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
            }}
        >

            <Typography component="h1" variant="h5">
                Edit Form
            </Typography>
            <Box >
                <SMInput
                    margin="normal"
                    onChange={(e) => { setEditData({ ...editData,class: e.target.value }) }}
                    required
                    value={formEdit.class}
                    label="Class"
                    type="text"
                    id="password"
                    autoComplete="current-password"
                />
                <SMInput
                    margin="normal"
                    onChange={(e) => { setEditData({ ...editData,section: e.target.value }) }}
                    required
                    label="Section"
                    type="text"
                    autoFocus
                />
                <span>Admission Date Start</span>
                <SMInput
                    margin="normal"
                    onChange={(e) => { setEditData({ ...editData, dateofstart: e.target.value }) }}
                    required
                    type="date"
                    autoComplete="current-password"
                />
                <span>Admission Date End</span>
                <SMInput
                    margin="normal"
                    required
                    onChange={(e) => { setEditData({ ...editData, dateofend: e.target.value }) }}
                    type="date"
                    autoComplete="current-password"
                />
                <SMInput
                    margin="normal"
                    required
                    label="Required Qualification"
                    onChange={(e) => { setEditData({ ...editData, qualification: e.target.value }) }}
                    type="text"
                    autoComplete="current-password"
                />
                <SMButton
                    type="submit"
                    label="Update"
                    fullWidth
                    variant="contained"
                    onClick={editfunc}
                    sx={{ mt: 3, mb: 2 }}

                    Submit
                />

            </Box>
        </Box>
    </Container>
</ThemeProvider>
    </Box>
  );
}
export default EditForm;
